body:
This fix changes how exchange tasks are executed in order to allow multiple tasks to run concurrently.

In the past, exchange tasks were launched as child coroutines of a specified `CoroutineScope`. At some point this logic was updated so that `ExchangeTaskExecutor.execute()` would create its own scope and launch jobs to execute tasks like so:

```kt
// ExchangeTaskExecutor.kt, shorted to emphasize the relevant parts
suspend fun execute(exchangeStep: ApiClient.ClaimedExchangeStep) = coroutineScope {
  launch {
    // executes exchangeStep in a try/catch block
  }
}
```

Since the outer `coroutineScope { ... }` block doesn't return until all of its child coroutines have completed, this effectively made it so that at most 1 exchange task could be executed at a time.

With this fix, we instead launch child coroutines from the site which calls `ExchangeTaskExecutor.execute()`, which once again allows us to run multiple exchange tasks concurrently.
